                  let tileNumbers = [];

                        openCards[0].classList.remove("flipped");
                        openCards[1].classList.remove("flipped");

                          gsap.to(openCards[0], { duration: 0.3, rotationY: 180 });

                          overlay.style.display = "none";
                          openCards = [];

                        gsap.to(openCards[1], { duration: 0.3, scale: 0 });
                        gsap.to(s1, { duration: 0.2, scale: 0, transformOrigin:"70% 30%" });
                        gsap.to(s2, { duration: 0.2, scale: 0, transformOrigin:"70% 30%" });
                        gsap.to("#match", { duration:.2, opacity: 0 });
                        overlay.style.display = "none";

                          setTimeout(initiateEnd, 1000);
                          gsap.to("#timerHolder", { duration: 0.5, opacity: 0 });
                        }

              }
              if (counter > -1) {
                // Some other condition is false, so clearInterval is never reached
                timerElement.innerHTML = counter + "s";
        
                if(counter == 0){
                  timerElement.innerHTML = counter;
                  clearInterval(intervalId);
                  timerElement.style.display = "none";
                  if(!isGameOver){
                    console.log("!isGameOver")
                    tryAgain();
                  }
                }
              }
            }, 1000);
        }

        /*------------ Buttons START  ------------*/


        function playAgainEnd(){

          gsap.set("#hand, #play_btn ", { opacity: 0 });

          gsap.to("#playAgainEndBtn", { scale: 0.9, duration: 0.1, ease: "power1.inOut", onComplete: () => { gsap.to("#playAgainEndBtn", { scale: 1, duration: 0.15, ease: "bounce.out" }); } });
          gsap.to("#try", { scale: 0.9, duration: 0.1, ease: "power1.inOut", onComplete: () => { gsap.to("#try", { scale: 1, duration: 0.15, ease: "bounce.out" }); } });

          document.getElementById("endSet").style.display = "none";

          userMatched = 0;
          counter = 91;
          clearInterval(intervalId);
          gameRefreshed(); 
          shuffle(cardTypeArray);
            // Loop through each face container and update the <img> inside
            document.querySelectorAll('.faces').forEach((faceDiv, index) => {
              const img = faceDiv.querySelector('img');
              if (img && cardTypeArray[index]) {
                //img.src = cardTypeArray[index];
                img.src = tiles["tile" + ( cardTypeArray[index] )];
                img.classList = "tile"+ cardTypeArray[index] + " no-drag";
              }

        }

        /*------------ Buttons End  ------------*/

        function initiateEnd(){

          document.getElementById("endSet").style.display = "block";
          document.getElementById("endSet").style.display = "block";
          gsap.to("#buttons, #endSet", { duration:.5, opacity: 1, ease:"power1.out", delay:.2 })

          gsap.to("#f2_txt2_img, #msg, .score", { duration:.5, opacity: 1, ease:"power1.out", delay:.2 })
          
          document.getElementById("score").innerHTML = formatTime(timeTaken);
          timeTaken = 0;
        
          // add listener
          document.getElementById("seeMoreBtn").addEventListener("click", gotoFinalFrame);
          document.getElementById("playAgainEndBtn").addEventListener("click", playAgainEnd);
        }

        function gotoFinalFrame(){
          gsap.to("#seeMoreBtn", { scale: 0.9, duration: 0.1, ease: "power1.inOut", onComplete: () => { gsap.to("#seeMoreBtn", { scale: 1, duration: 0.15, ease: "bounce.out" }); } });
          gsap.to("#boxShadowFrame2", { duration:.75, scale:1, x:0, y:0, opacity: 1})

          gsap.to("#f2_txt3_img", { duration:.5, opacity: 1, delay: 1})

         /*------------ Buttons Lost Game  ------------*/

        function tryAgain(){

          document.getElementById("loseSet").style.display = "block";

      function playAgain(){

        gsap.set(".ps", { scale: 1});

        document.getElementById("refreshSet").style.display = "none";

        document.getElementById("try").style.display = "none";

        function clearExceptFirst() {
          const div = document.getElementById("puzzleHolder");
          while (div.children.length > 1) {

        document.getElementById("endFrame").style.display = "block";
        document.getElementById("buttons").style.display = "none";
        var eFTL = gsap.timeline({});

        eFTL
            .addLabel("endFrame", "0")
            .to(".pack-shot", { duration:.5, opacity: 1, ease:"power3.out" }, "endFrame+=.5")
            .to("#endFramePlayBtn", { duration:.75, opacity: 1, ease:"power3.out" }, "endFrame+=1")
            .to("#overlay, #f2_txt1_img, #puzzleHolder", { duration:.7, opacity: 0, ease:"power3.out" }, "endFrame")

        document.getElementById("endFramePlayBtn").addEventListener("click", finalPlayAgainInitiated)

      function finalPlayAgainInitiated(){

      function endToFirst(){

        gsap.set("#endFrame, #overlay", { opacity: 1})
        gsap.set("#endBG", { scale: .77, y:-170, opacity:1})

        shuffle(cardTypeArray);

            img.src = tiles["tile" + ( cardTypeArray[index] )];
            img.classList = "tile"+ cardTypeArray[index] + " no-drag";
          }
        });
        
      }

      function gameRefreshed(){
        gsap.to("#frame2, #endBG, #timerHolder, #endFrameImage, #f2_txt2_img, #f2_txt3_img, #endFramePlayBtn", { duration:.5, opacity:0, ease:"power1.out"})
        gsap.to("#frame1", { duration:0, x:0, opacity:1, ease:"power1.out"})
        
        isGameRefreshed = true;
        document.getElementById("play_btn").addEventListener("click", startPuzzle)
      }

    }

      function formatTime(seconds) {
        const mins = Math.floor(seconds / 60);
        const secs = seconds % 60;

        // Pad with zeros if needed
        const formatted = 
          String(mins).padStart(2, '0') + ':' + 
          String(secs).padStart(2, '0');

        return formatted;
      }

      

      function shuffle(array) {
      let currentIndex = array.length;

      // While there remain elements to shuffle...
      while (currentIndex != 0) {

        // Pick a remaining element...
        let randomIndex = Math.floor(Math.random() * currentIndex);
        currentIndex--;

        // And swap it with the current element.
        [array[currentIndex], array[randomIndex]] = [
          array[randomIndex], array[currentIndex]];
      }
      }
